## Inline Styles

Inline styles are the most basic way to style a react app. You can use the style prop to add inline styles to any element. The style prop takes an object with CSS properties as keys and values as values. For example, to add a red background color to a div, you can use the following code:
```
<div style={{ backgroundColor: 'red' }}>Hello World!</div>
```
## CSS Modules

CSS Modules are a way to scope CSS styles to a specific component. This is useful when you want to avoid naming conflicts between different components. To use CSS Modules, you need to create a CSS file and import it into your component. For example, to create a CSS file called styles.css and import it into a component called App.js, you can use the following code:
```
import React from 'react';
import styles from './styles.css';

const App = () => {
  return (
    <div className={styles.container}>
      <h1 className={styles.title}>Hello World!</h1>
    </div>
  );
};

export default App;
