Compiler optimization is a process of improving the performance of a program by making changes to the source code. It involves the use of various techniques to reduce the time and memory required to execute the program. Compiler optimization can be done at different levels, such as the source code level, the intermediate code level, and the machine code level.
Here are some of the most popular compiler optimization techniques with example codes:
1. Loop Unrolling: This technique involves unrolling the loops in the source code to reduce the number of iterations required to execute the loop. For example, consider the following code snippet:
for (int i = 0; i < 100; i++) {
    sum += i;
In this code, the loop is executed 100 times. By unrolling the loop, we can reduce the number of iterations required to execute the loop. For example, we can unroll the loop as follows:
sum += 0;
sum += 1;
sum += 2;
sum += 3;
sum += 4;
sum += 5;
sum += 6;
sum += 7;
sum += 8;
sum += 9;
sum += 10;
In this unrolled version of the loop, the loop is executed only 10 times, which is a significant reduction in the number of iterations required to execute the loop.
2. Loop Invariant Code Motion: This technique involves moving the code that is not affected by the loop outside of the loop. For example, consider the following code snippet:
for (int i = 0; i < 100; i++) {
    sum += i;
In this code, the variable “sum” is not affected by the loop, as it is only used to store the sum of the values of “i”. By moving the code that is not affected by the loop outside of the loop, we can reduce the number of iterations required to execute the loop. For example, we can move the code that is not affected by the loop outside of the loop as follows:
sum = 0;
